{'pk': 18079758364214466, 'user_id': 1399382657, 'text': 'Existe el amor a primera vista? Este libro es para los que creen que si.  El mismo autor que El peregrino que publico패 @editorial_sigilo en este caso es un fragmento de 랎he hill of summer esta패 traducido por @gabrielbarsky e ilustrado por @maricelrodriguezclark e impreso con belleza como todas las ediciones de @imprenta_rescate. .

La edicio패n consta de 80 ejemplares numerados. Las cubiertas fueron impresas tipogra패ficamente con tipos mo패viles de madera y plomo en tinta dorada. El interior fue impreso en laser en papel Neutech de 116g/m2.

El ingle패s J. A. Baker sale a caminar por el campo y atraviesa los bosques. Va descubriendo en la luz, en el aire, en el perfume de las flores, la temporada ca패lida que se aproxima. Para todo el que le gusta Thoreau y la literatura sobre naturaleza y naturalistas #libros #librorecomendado #librosrecomendados #naturaleza #johnalecbaker #bosques', 'type': 1, 'created_at': 1599939903, 'created_at_utc': 1599939903, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 1399382657, 'username': 'libreria.micasa', 'full_name': 'LibreriaMiCasa', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/61938044_380503962570026_3947842009003196416_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=6PsbLN4GNDkAX-xoE5B&_nc_tp=25&oh=3541a14786da5f66ad872db2ee7d6c5c&oe=5FD49612', 'profile_pic_id': '2061257041611222246_1399382657', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604967726, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2396682772514255788, 'has_translation': True, 'private_reply_status': 0}

{'pk': 17864729755945920, 'user_id': 1399382657, 'text': 'Los libros a veces tienen que esperar su momento para llegar.  Ahora que estamos adentro, leamos este diario del afuera de Annie Ernaux.  Va un fragmento al azar: Una nena, en el tren, obliga a la mama패 a que le lea un libro. Cada pa패gina empieza asi패: 럑쯈ue패 hora es? 뉸s la hora de... (almorzar, ir a la escuela, darle de comer al gato, etc.). La madre lee en voz alta una vez. La nena exige leerlo ella misma aunque todavi패a no sabe co패mo. Al parecer, solo retuvo de memoria lo que la madre le leyo패 (seguramente ya varias veces) porque se equivoca en las acciones que son apropiadas para tal o cual hora. La mama패 la corrige. La nena repite llena de ju패bilo, cada vez ma패s fuerte: Son las cuatro: es la hora de pasear al bebe패. Son las cinco: es la hora de cambiarle el agua al pez.... Experimenta un placer cada vez ma패s agitado al repetir la ronda implacable de horas y actividades autoritariamente ligadas. Se excita, no para de moverse en el asiento, pasa las pa패ginas del libro con una especie de rabia, 람ue패 hora es, es la hora de. Normalmente ese ve패rtigo de la repeticio패n, frecuente en los chicos, alcanza pronto su paroxismo: gritos, llantos y una cachetada. En este caso, la nena se abalanza sobre la madre y le dice: Te quiero morder.

Hoy domingo por la man팪ana, en la plaza de Les Linandes, el verdulero que linda con el Franprix refresca las lechugas con una regadera chiquita. Malestar, como si estuviera orina패ndolas. Es un hombre flaco, delantal azul, con bigote finito. En el estacionamiento, el chico que junta los changuitos esta패 apoyado contra una pared. Tiene entre veinticinco y treinta an팪os. Se le acerca un tipo: 럑쯈uere패s un cigarrillo?. Se despega de la pared y toma un cigarrillo sin sacarse los guantes gruesos de lana. Lo enciende con el cigarrillo del tipo. Hace fri패o y el aire es puro.

En la carniceri패a del pueblo, ma패s abajo de la Ciudad Nueva, la gente esperaba que la atiendan. Cuando llego패 su turno una mujer dijo: Quisiera un churrasco para un hombre. Despue패s el carnicero pregunto패: 럑쮸lgo ma패s? 늁ada ma패s, dijo sacando el monedero. @milenacaserola #libros #librosrecomendados #narrativa #libreriamicasa', 'type': 1, 'created_at': 1594749830, 'created_at_utc': 1594749830, 'content_type': 'comment', 'status': 'Active', 'bit_flags': 0, 'did_report_as_spam': False, 'share_enabled': False, 'user': {'pk': 1399382657, 'username': 'libreria.micasa', 'full_name': 'LibreriaMiCasa', 'is_private': False, 'profile_pic_url': 'https://instagram.faep9-2.fna.fbcdn.net/v/t51.2885-19/s150x150/61938044_380503962570026_3947842009003196416_n.jpg?_nc_ht=instagram.faep9-2.fna.fbcdn.net&_nc_ohc=6PsbLN4GNDkAX-xoE5B&_nc_tp=25&oh=3541a14786da5f66ad872db2ee7d6c5c&oe=5FD49612', 'profile_pic_id': '2061257041611222246_1399382657', 'is_verified': False, 'has_anonymous_profile_picture': False, 'is_unpublished': False, 'is_favorite': False, 'account_badges': [], 'latest_reel_media': 1604967726, 'story_reel_media_ids': []}, 'is_covered': False, 'media_id': 2353250813180292289, 'has_translation': True, 'private_reply_status': 0}

